  let i = 0;
  let text = "Hi, I'm Michael Sabzevari!"
  let speed = 50;
  function typewriter() {
    if (i < text.length) {
      document.getElementsByTagName('h1').innerHTML += text.charAt(i);
      i++;
      setTimeout(typewriter, speed)
    }
  }
    return (
      <div className="header">
        <div className="title typewriter">
          <h1>{typewriter}</h1>
          <h2>Software Engineer in NYC</h2>
          <Navbar />
        </div>
      </div>
    );
  }

  export default Header;
